import React, { useState } from 'react';

function CalculatorForm({ onSubmit }) {
    const [formData, setFormData] = useState({
        inflationRate: 2.0,
        dividendGrowthRate: 5.0,
        dividendYield: 0.04,
        dividendFrequency: 'quarterly',
        taxStatus: false,
        reinvestDividends: true,
        initialInvestment: 10000,
        monthlyInvestment: 500,
        monthlyIncrease: 5,
    });

    const handleChange = (e) => {
        const { name, value } = e.target;
        setFormData({ ...formData, [name]: value });
    };

    const handleSubmit = (e) => {
        e.preventDefault();
        onSubmit(formData);
    };

    return (
        <form onSubmit={handleSubmit}>
            <div>
                <label>물가상승률 (%)</label>
                <input
                    type="number"
                    name="inflationRate"
                    value={formData.inflationRate}
                    onChange={handleChange}
                />
            </div>

            <div>
                <label>배당 성장률 (%)</label>
                <input
                    type="number"
                    name="dividendGrowthRate"
                    value={formData.dividendGrowthRate}
                    onChange={handleChange}
                />
            </div>

            <div>
                <label>시가 배당률 (%)</label>
                <input
                    type="number"
                    name="dividendYield"
                    value={formData.dividendYield}
                    onChange={handleChange}
                />
            </div>

            <div>
                <label>배당 주기</label>
                <select
                    name="dividendFrequency"
                    value={formData.dividendFrequency}
                    onChange={handleChange}
                >
                    <option value="quarterly">분기</option>
                    <option value="semiannually">반기</option>
                    <option value="annually">연간</option>
                </select>
            </div>

            <div>
                <label>과세 여부</label>
                <input
                    type="checkbox"
                    name="taxStatus"
                    checked={formData.taxStatus}
                    onChange={(e) => setFormData({ ...formData, taxStatus: e.target.checked })}
                />
            </div>

            <div>
                <label>배당 재투자</label>
                <input
                    type="checkbox"
                    name="reinvestDividends"
                    checked={formData.reinvestDividends}
                    onChange={(e) => setFormData({ ...formData, reinvestDividends: e.target.checked })}
                />
            </div>

            <div>
                <label>초기 투자금 (원)</label>
                <input
                    type="number"
                    name="initialInvestment"
                    value={formData.initialInvestment}
                    onChange={handleChange}
                />
            </div>

            <div>
                <label>월 적립식 투자금 (원)</label>
                <input
                    type="number"
                    name="monthlyInvestment"
                    value={formData.monthlyInvestment}
                    onChange={handleChange}
                />
            </div>

            <div>
                <label>월 적립식 투자금 증액율 (%)</label>
                <input
                    type="number"
                    name="monthlyIncrease"
                    value={formData.monthlyIncrease}
                    onChange={handleChange}
                />
            </div>

            <button type="submit">계산하기</button>
        </form>
    );
}

export default CalculatorForm;
